import React from 'react';
import ReactNode from './ReactNode';
import { Provider } from 'react-dims';

const App=()=>{
  const data = [4,3,7,2,2,2,2,7,3,4];
  return (
    <div className="myLayout">
      <div className="coolThing">
        <Provider>
          <ReactNode data={data}/>
        </Provider>
      </div>
    </div>
  );
};

export default App;
